import React from 'react';
import {
  Drawer,
  DrawerBody,
  DrawerFooter,
  DrawerHeader,
  DrawerOverlay,
  DrawerContent,
  DrawerCloseButton,
  Button,
  VStack,
  HStack,
  Text,
  Box,
  IconButton,
  NumberInput,
  NumberInputField,
  NumberInputStepper,
  NumberIncrementStepper,
  NumberDecrementStepper,
} from '@chakra-ui/react';
import { DeleteIcon } from '@chakra-ui/icons';
import { useCart } from '../contexts/CartContext';
import { useNavigate } from 'react-router-dom';

export default function Cart({ isOpen, onClose }) {
  const { cartItems, removeFromCart, updateQuantity, getTotal, clearCart } = useCart();
  const navigate = useNavigate();

  const handleCheckout = () => {
    onClose();
    navigate('/checkout');
  };

  return (
    <Drawer isOpen={isOpen} placement="right" onClose={onClose} size="md">
      <DrawerOverlay />
      <DrawerContent>
        <DrawerCloseButton />
        <DrawerHeader>Your Cart</DrawerHeader>

        <DrawerBody>
          {cartItems.length === 0 ? (
            <Text>Your cart is empty</Text>
          ) : (
            <VStack spacing={4} align="stretch">
              {cartItems.map((item) => (
                <Box
                  key={item.plan._id}
                  p={4}
                  borderWidth="1px"
                  borderRadius="lg"
                >
                  <HStack justify="space-between">
                    <VStack align="start" flex={1}>
                      <Text fontWeight="bold">{item.plan.name}</Text>
                      <Text color="gray.600">₹{item.plan.price}/user/year</Text>
                    </VStack>
                    <NumberInput
                      value={item.quantity}
                      min={1}
                      max={item.plan.maxUsers}
                      onChange={(value) => updateQuantity(item.plan._id, parseInt(value))}
                      size="sm"
                      maxW={20}
                    >
                      <NumberInputField />
                      <NumberInputStepper>
                        <NumberIncrementStepper />
                        <NumberDecrementStepper />
                      </NumberInputStepper>
                    </NumberInput>
                    <IconButton
                      icon={<DeleteIcon />}
                      onClick={() => removeFromCart(item.plan._id)}
                      variant="ghost"
                      colorScheme="red"
                    />
                  </HStack>
                  <Text mt={2} fontWeight="bold" textAlign="right">
                    Subtotal: ₹{item.plan.price * item.quantity}
                  </Text>
                </Box>
              ))}
            </VStack>
          )}
        </DrawerBody>

        <DrawerFooter borderTopWidth="1px">
          <VStack spacing={4} width="100%">
            <HStack justify="space-between" width="100%">
              <Text fontWeight="bold">Total:</Text>
              <Text fontWeight="bold">₹{getTotal()}</Text>
            </HStack>
            <HStack width="100%">
              <Button variant="outline" mr={3} onClick={clearCart} isDisabled={cartItems.length === 0}>
                Clear Cart
              </Button>
              <Button 
                colorScheme="blue" 
                onClick={handleCheckout}
                isDisabled={cartItems.length === 0}
                flex={1}
              >
                Proceed to Checkout
              </Button>
            </HStack>
          </VStack>
        </DrawerFooter>
      </DrawerContent>
    </Drawer>
  );
}
